import React from 'react';
import { Parallax } from 'react-scroll-parallax'
import './Header.scss'

function Header() {
    const text = 'Parallax'.split('');
    return (
        <div>
            <h1>some element</h1>
            <div className="text-div">
                <span className="text-span">
                    {text.map((letter, i) => (
                        <Parallax
                            key={`text-${i}`}
                            x={[-(100 * i), 50]}
                            className="text"
                        >
                            {console.log(i)}
                            {letter}
                        </Parallax>
                    ))}
                </span>
            </div>
        </div>
    );
}

export default Header;
